import React from "react";

function Note() {
  return (
    <div className="note">
      <h1>This is the note title</h1>
      <p>This is the note content</p>
      <dt> 
      <span>{props.title} </span>
      </dt>
      <dd>{props.content}</dd>
    </div>
  );
}

export default Note;
